    // console.log(props);
    const [value, setValue] = useState('')

    const user = useSelector(store => store.userData.userOnline)

    return(
        <>
    <ul>
        {
        props.array.map((cat, index) => {
        return(
            <li 
            onClick={(e) => console.log(e.target.innerText)} 
            key={index+cat}>{ cat }
            </li>
                )
            })
